import React, { useState, useRef, useEffect } from 'react'
import './About.css'
import LeftArrow from "../assets/icons/short-arrow-left.svg"
import RightArrow from "../assets/icons/short-arrow-right.svg"
import QuoteIcon from "../assets/icons/quotes.svg"
import UserImage from "../assets/icons/span-7.svg"

function About() {
  // Testimonials data
  const testimonials = [
    {
      quote: "Byway's tech courses are top-notch! As someone who's always looking to stay ahead in the rapidly evolving tech world, I appreciate the up-to-date",
      name: "Jane Doe",
      role: "Designer",
      image: UserImage
    },
    {
      quote: "An incredible learning platform that offers practical, cutting-edge technology courses. The curriculum is designed to keep you ahead of the curve.",
      name: "John Smith",
      role: "Software Engineer",
      image: UserImage
    },
    {
      quote: "Byway has transformed my understanding of tech. The courses are comprehensive, engaging, and truly practical. The curriculum is designed to.",
      name: "Emily Wong",
      role: "Product Manager",
      image: UserImage
    },
    {
      quote: "A game-changing educational platform that provides real-world skills and insights into the latest technological trends.engaging, and truly practical.",
      name: "Michael Chen",
      role: "Data Scientist",
      image: UserImage
    },
    {
      quote: "The most up-to-date and interactive tech learning experience I've ever encountered. Highly recommended!engaging, and truly practical real-world .",
      name: "Sarah Johnson",
      role: "UX Designer",
      image: UserImage
    },
    {
      quote: "Byway's approach to tech education is revolutionary. The depth and quality of content are unmatched. real-world learning experience I've encountered.  ",
      name: "David Kim",
      role: "Cloud Architect",
      image: UserImage
    }
  ];

  // State management
  const [currentSlide, setCurrentSlide] = useState(0);
  const [isAnimating, setIsAnimating] = useState(false);
  const sliderRef = useRef(null);

  // Slide navigation functions
  const handleNextSlide = () => {
    if (isAnimating) return;

    setIsAnimating(true);
    setCurrentSlide((prev) => 
      (prev + 1) % Math.ceil(testimonials.length / 3)
    );
  };

  const handlePrevSlide = () => {
    if (isAnimating) return;

    setIsAnimating(true);
    setCurrentSlide((prev) => 
      prev === 0 
        ? Math.ceil(testimonials.length / 3) - 1 
        : prev - 1
    );
  };

  // Get current slide's testimonials
  const getSlideTestimonials = () => {
    const startIndex = currentSlide * 3;
    return testimonials.slice(startIndex, startIndex + 3);
  };

  // Animation end handler
  useEffect(() => {
    const slider = sliderRef.current;
    
    const handleAnimationEnd = () => {
      setIsAnimating(false);
    };

    if (slider) {
      slider.addEventListener('animationend', handleAnimationEnd);
      return () => {
        slider.removeEventListener('animationend', handleAnimationEnd);
      };
    }
  }, [currentSlide]);

  return (
    <section id="about">
      <section className="wrapper">
        <section className="about">
          <div className="head">
            <h3>What Our Customer Say About Us</h3>
            <div className="right">
              <img 
                className="left-arrow" 
                src={LeftArrow} 
                alt='Left-Arrow' 
                onClick={handlePrevSlide}
                style={{cursor: 'pointer'}}
              />
              <img 
                className="right-arrow" 
                src={RightArrow} 
                alt='Right-Arrow' 
                onClick={handleNextSlide}
                style={{cursor: 'pointer'}}
              />
            </div>
          </div>
          <div className="body">
            <div 
              ref={sliderRef}
              className={`testimonial-slider ${
                isAnimating 
                  ? (currentSlide === 0 ? 'slide-prev' : 'slide-next')
                  : ''
              }`}
            >
              <ul>
                {getSlideTestimonials().map((testimonial, index) => (
                  <li key={index}>
                    <img src={QuoteIcon} alt='Quote' />
                    <p>"{testimonial.quote}"</p>
                    <div className="role">
                      <img src={testimonial.image} alt='User-Image' />
                      <div className="name">
                        <h4>{testimonial.name}</h4>
                        <small>{testimonial.role}</small>
                      </div>
                    </div>
                  </li>
                ))}
              </ul>
            </div>
          </div>
        </section>
      </section>
    </section>
  )
}

export default About
